  input: 'TEXT,F3XA,,"UMP refers to the Unified Membership Program.  A portion of
    receipts from members received by the Libertarian National Committee is returned
    to the state affiliates.  In-Kind disbursements to the state affiliates refer
    to the printed tabloid ''Libertarian Viewpoints'' being furnished in lieu of a
    portion of receipts from members.  The value of the In-Kind disbursement to Iowa
    was $33.24, the value of the In-Kind disbursement to North Carolina was $70.00.  The
    following advertisers had their advertisement published and the debt listed has
    been settled:  David Hollist and Tom Pilitowski.  Dianne Pilcher has her listed
    debt of $100.00 settled.  All expenditures on behalf of specifically identified
    federal candidates are listed as coordinated expenditures.  The disputed debt
    with the Atlanta Marriott has been settled, the original amount of the disputed
    invoice was reported in the July monthly report in the amount of $29,674.23;  the
    disputed amount was reported in the July monthly report as $9,047.16.  The debt
    listed in the August monthly reported has been listed as forgiven/settled with
    the undisputed debt amount entered as $20,627.07."'
